import React, { Component } from 'react';
import subject1 from './res/subject1.png';
import subject2 from './res/subject2.png';
import subject3 from './res/subject3.png';
import './App.css';

export default class App extends Component{


  render () {
    return (
      <div className="App">
        <header className="App-header">
          <div>
            <img src={subject1} className="App-logo" alt="logo" onClick={() => this.renderWheel()} />
          </div>
          <div>
            <img src={subject2} className="App-logo" alt="logo" />
          </div>
          <div>
            <img src={subject3} className="App-logo" alt="logo" />
          </div>
        </header>
      </div>
    );
  }

}
